import React from 'react';
import styled from 'styled-components';
import { useHistory } from 'react-router-dom';
import { useCart } from '../hooks/useCart';

const CartContainer = styled.div`
  font-family: Arial, sans-serif;
  padding: 20px;
  padding-left: 50px;
  padding-right: 50px;
`;

const CartItem = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 10px 0;
  border-bottom: 1px solid #e0e0e0;
  position: relative;
`;

const CartItemImage = styled.img`
  width: 100px;
  height: 100px;
  object-fit: cover;
  margin-right: 20px;
`;

const CartItemDetails = styled.div`
  display: flex;
  flex-direction: column;
  flex: 1;
`;

const CartItemName = styled.h3`
  margin: 0;
`;

const CartItemInfo = styled.p`
  margin: 5px 0;
  color: #555;
`;

const CartItemPrice = styled.p`
  margin: 5px 0;
  font-weight: bold;
`;

const QuantityControls = styled.div`
  display: flex;
  align-items: center;
  margin-top: 10px;
  margin-right: 20px;
`;

const QuantityButton = styled.button`
  padding: 5px 10px;
  background-color: #ff5a5f;
  color: white;
  border: none;
  border-radius: 5px;
  cursor: pointer;
`;

const QuantityDisplay = styled.span`
  padding: 0 10px;
  font-size: 16px;
  font-weight: bold;
`;

const RemoveButton = styled.button`
  position: absolute;
  top: 10px;
  right: 10px;
  background: none;
  border: none;
  color: #ff5a5f;
  font-size: 24px;
  cursor: pointer;
  padding: 0;
`;

const CheckoutButton = styled.button`
  padding: 15px;
  background-color: #ff5a5f;
  color: white;
  border: none;
  border-radius: 5px;
  cursor: pointer;
  font-size: 16px;
  width: 100%;
  margin-top: 20px;
`;

const Summary = styled.div`
  text-align: right;
  margin-top: 20px;
`;

const SummaryItem = styled.p`
  margin: 5px 0;
  font-weight: bold;
`;

function Cart() {
  const { cart, removeFromCart, updateQuantity } = useCart();
  const history = useHistory();

  const subtotal = cart.reduce((total, item) => total + parseFloat(item.price.replace('$', '')) * item.quantity, 0);
  const tax = subtotal * 0.18;
  const total = subtotal + tax;

  const handleUpdateQuantity = (item, quantity) => {
    if (quantity <= 0) {
      quantity = 1;
    }
    updateQuantity(item, quantity);
  };

  return (
    <CartContainer>
      <h1>Your Cart</h1>
      {cart.length === 0 ? (
        <p>Your cart is empty</p>
      ) : (
        cart.map((item, index) => (
          <CartItem key={index}>
            <CartItemImage src={item.imageUrl || 'https://via.placeholder.com/100'} alt={item.name} />
            <CartItemDetails>
              <CartItemName>{item.name}</CartItemName>
              <CartItemInfo>{item.restaurantName}</CartItemInfo>
              <CartItemInfo>{item.deliveryTime}</CartItemInfo>
              <CartItemPrice>Price: {item.price}</CartItemPrice>
            </CartItemDetails>
            <QuantityControls>
              <QuantityButton onClick={() => handleUpdateQuantity(item, item.quantity - 1)}>-</QuantityButton>
              <QuantityDisplay>{item.quantity}</QuantityDisplay>
              <QuantityButton onClick={() => handleUpdateQuantity(item, item.quantity + 1)}>+</QuantityButton>
            </QuantityControls>
            <RemoveButton onClick={() => removeFromCart(index)}>Ã—</RemoveButton>
          </CartItem>
        ))
      )}
      {cart.length > 0 && (
        <>
          <Summary>
            <SummaryItem>Subtotal: ${subtotal.toFixed(2)}</SummaryItem>
            <SummaryItem>Tax (18%): ${tax.toFixed(2)}</SummaryItem>
            <SummaryItem>Total: ${total.toFixed(2)}</SummaryItem>
          </Summary>
          <CheckoutButton onClick={() => history.push('/checkout')}>
            Proceed to Checkout
          </CheckoutButton>
        </>
      )}
    </CartContainer>
  );
}

export default Cart;
